    data: |
      SELECT - col1 * + col0 * + 34 AS col0, - 60 AS col1 FROM tab0 (FORMAT parquet) WHERE NOT + 8 + + col0 IS NULL;
  - name: tab0

outputs:
  - name: q8403.out
    data: |
      -3298	-60
      -41310	-60
      -62118	-60
